import React, { Component } from "react";
import styled from "styled-components";

class Footer extends Component {
  render() {
    const Div_footer_main = styled.div`
    height: 447px;
    width: 1337px;
    position: relative;
top: -1982px;
margin: 0 auto;
z-index: 200;
    `


    return (
      <Div_footer_main>
      <p>ABOUT</p>
      <p>PROJECT</p>
      <p>ME</p>

      </Div_footer_main>
    );
  }
}

export default Footer;
